import React from 'react'
import { Link } from 'react-router-dom'

const Header = () => {

    return(
        <div className="Header">
                <Link to={`/`}>
                <a>Home</a>
                </Link>
                <Link to={`/find`}>
                <a>Find</a>
                </Link>
        </div>
        
    )
}

export default Header;
